import React from 'react'

const TradeHistroy = () => {
  return (
    <>
    <div className='header text-center'>
      <h3>Interactive Broker's Trading Bots</h3>
      <button className='btn btn-primary mt-2'  onClick = {() => setModal(true)}>Create Bot</button>
    </div>    
    </>
  )
}

export default TradeHistroy
